import{_ as e,c as r,o as t,a}from"./app.820bb01d.js";const k=JSON.parse('{"title":"What is Interlock?","description":"","frontmatter":{},"headers":[{"level":2,"title":"What is Interlock?","slug":"what-is-interlock"},{"level":3,"title":"Addressing a Persistent Threat: Phishing Attacks","slug":"addressing-a-persistent-threat-phishing-attacks"},{"level":3,"title":"Leveraging Web3 to Solve Legacy Web2 Threats","slug":"leveraging-web3-to-solve-legacy-web2-threats"},{"level":3,"title":"Key Achievements","slug":"key-achievements"},{"level":2,"title":"About $ILOCK","slug":"about-ilock"},{"level":2,"title":"Useful links","slug":"useful-links"},{"level":2,"title":"Support & Bug reports","slug":"support-bug-reports"},{"level":2,"title":"The Team","slug":"the-team"}],"relativePath":"index.md"}'),n={name:"index.md"},i=a('<h2 id="what-is-interlock" tabindex="-1">What is Interlock? <a class="header-anchor" href="#what-is-interlock" aria-hidden="true">#</a></h2><p>Introducing Interlock, revolutionary blockchain-based security solutions for individuals and enterprises, forging a safer internet. Our AI-driven security product, ThreatSlayer, defends against browser attacks while rewarding users with $ILOCK for sharing security data. We monetize the shared security data in the $11 billion yearly B2B threat intel market, creating a first-of-its-kind crowdsourced threat intelligence, along with a suite of enterprise security products.</p><h3 id="addressing-a-persistent-threat-phishing-attacks" tabindex="-1">Addressing a Persistent Threat: Phishing Attacks <a class="header-anchor" href="#addressing-a-persistent-threat-phishing-attacks" aria-hidden="true">#</a></h3><p>For more than two decades, phishing attacks have been a significant threat to online security, causing financial harm. In Web3, the risk is even more substantial, with a single click potentially leading to the loss of digital assets. In 2022, $9.7 billion was stolen in crypto hacks and scams.</p><h3 id="leveraging-web3-to-solve-legacy-web2-threats" tabindex="-1">Leveraging Web3 to Solve Legacy Web2 Threats <a class="header-anchor" href="#leveraging-web3-to-solve-legacy-web2-threats" aria-hidden="true">#</a></h3><p>Interlock\u2019s AI-powered security extension ThreatSlayer, is a free, enterprise-grade security extension that protects against browser-based threats, phishing attacks, and bad downloads. You can add it to your Chrome, Brave, Edge, or Opera browser, and from there it runs quietly in the background, scanning visited websites and locking down potentially dangerous pages.</p><p>With the future version of ThreatSlayer, users will earn $ILOCK tokens for sharing anonymized security data and staking tokens on misclassified pages. AI and human interaction together create smarter security products, preventing zero-day attacks and better security for all network participants. This incentivized security approach enables a stronger network, product, and safer internet for everyone.</p><h3 id="key-achievements" tabindex="-1">Key Achievements <a class="header-anchor" href="#key-achievements" aria-hidden="true">#</a></h3><p>Interlock stands at the forefront of innovative cybersecurity. The Interlock team, consisting of Y-Combinator graduates and tech marketing experts, brings extensive B2B marketing and sales experience</p><p>Interlock released ThreatSlayer beta, boasting 30,000+ weekly users Secured $2.8 million in seed funding from investors like Outlier Ventures, Max Stealth, Fish Dao, Pluto Capital, and more Recognized on Entrepreneur&#39;s &quot;Elevator Pitch\u201D</p><h2 id="about-ilock" tabindex="-1">About $ILOCK <a class="header-anchor" href="#about-ilock" aria-hidden="true">#</a></h2><p>The $ILOCK utility token fuels our ecosystem of security products, fostering a collaborative security model by incentivizng network particpants to share seucrity data.</p><p><a href="https://docs.interlock.network/token/supply.html" target="_blank" rel="noopener noreferrer">View token supply, vesting and distribution here</a></p><h2 id="useful-links" tabindex="-1">Useful links <a class="header-anchor" href="#useful-links" aria-hidden="true">#</a></h2><ul><li><a href="https://discord.gg/YuxsG8znG2" target="_blank" rel="noopener noreferrer">Join us on Discord</a></li><li><a href="https://t.me/interlockchat" target="_blank" rel="noopener noreferrer">Join our Telegram</a></li><li><a href="https://www.twitter.com/interlockweb3" target="_blank" rel="noopener noreferrer">Follow us on Twitter</a></li></ul><h2 id="support-bug-reports" tabindex="-1">Support &amp; Bug reports <a class="header-anchor" href="#support-bug-reports" aria-hidden="true">#</a></h2><p>We are available to chat in our <a href="https://discord.gg/PbCYBbynqd" target="_blank" rel="noopener noreferrer">Discord</a> or <a href="https://t.me/+IxzitrEVH2A1ODYx" target="_blank" rel="noopener noreferrer">Telegram</a>, if you would like to ask any questions or just talk to the developers about how great their day is today \u{1F603} As for bug reports, please use the <a href="https://github.com/interlock-network/interlock-docs/issues" target="_blank" rel="noopener noreferrer">Issues tab</a> and create a new issue, whether it&#39;s a typo in the white paper or you want something added/removed.</p><h2 id="the-team" tabindex="-1">The Team <a class="header-anchor" href="#the-team" aria-hidden="true">#</a></h2><ul><li>Rick Deacon - <a href="https://github.com/rickdeaconx" target="_blank" rel="noopener noreferrer">rickdeaconx</a> - Project Owner &amp; CEO</li><li>Nick Z - <a href="https://github.com/galactic-beyond" target="_blank" rel="noopener noreferrer">galactic-beyond</a> - Project Owner &amp; Principal Engineer</li><li>Andy Ciacca - <a href="https://github.com/andycheech" target="_blank" rel="noopener noreferrer">andycheech</a> - Chief of Marketing</li><li>Dan T.S - <a href="https://github.com/teachrdan" target="_blank" rel="noopener noreferrer">JohnnyUtah</a> - Product Manager</li><li>John Mercouris - <a href="https://github.com/jmercouris" target="_blank" rel="noopener noreferrer">jmercouris</a> - Sr. Engineer</li><li>Blair Munro - <a href="https://github.com/blairmunroakusa" target="_blank" rel="noopener noreferrer">blairmunroakusa</a> - Software Engineer</li><li>Treva T. - <a href="https://github.com/Treevuhh" target="_blank" rel="noopener noreferrer">treevuhh</a> - Chaos Operations Coordinator</li><li>@Captain.Azero - Community Manager</li><li>@ReuX - Community Manager</li></ul><p><strong>Credits</strong></p><p><a href="https://interlock.network" target="_blank" rel="noopener noreferrer">Interlock</a></p>',21),o=[i];function s(l,h,c,d,u,p){return t(),r("div",null,o)}var b=e(n,[["render",s]]);export{k as __pageData,b as default};
